  @override
  String privacyBlock3aText(String appNameShort) {
    return 'ကျွန်ုပ်တို့သည်သင်၏မီတာဖတ်ခြင်းများကိုလျင်မြန်စွာဖြည့်ဆည်းပေးနိုင်ရန်အတွက် Phtoken0 ကိုဖန်တီးခဲ့ပြီးသင်၏စားသုံးမှုနှင့်ကုန်ကျစရိတ်များနှင့်အလားအလာရှိသောငွေစုများအကြောင်းပိုမိုသိရှိရန်စာရင်းဇယားများကိုအသုံးပြုသည်။ ဆိုလိုသည်မှာသင်သည် Phtoked1 တွင်ယေဘူယျအားဖြင့် \"အကြောင်းအရာ \'ဟုရည်ညွှန်းသည့်မည်သည့်ဒေတာများကိုမဆိုတွက်ချက်, တွက်ချက်ခြင်းသို့မဟုတ်သိမ်းနိုင်သည်။ ဤအချက်အလက်များကိုသင်၏မိုဘိုင်းဖုန်းတွင်သာသိမ်းထားသည်။\n\nGoogle Drive ဖြင့်စည်းညှိပါ။\nအကယ်. သင်သည် Google Drive ဖြင့်ထပ်တူပြုခြင်းကိုပြုလုပ်နိုင်ပါကသင်၏ဂူဂဲလ် Drive တွင် \'Phtoken Drive ရှိ Phtoken Drive တွင်\' Phtoken Drive ဟုခေါ်သောဖိုလ်ဒါတစ်ခုတွင်ပါ 0 င်သည်။ ဂူဂဲလ်နှင့်အတူဝင်ရောက်ခြင်းအားဖြင့်သင်၏အီးမေးလ်လိပ်စာကို developer ကိုမြင်နိုင်လိမ့်မည်။';
