  @override
  String privacyBlock3bText(String googleApiAgreement) {
    return '$googleApiAgreement\n\nတည်နေရာဒေတာ။\nသုံးစွဲသူ၏ အပြုအမူနှင့် အနာဂတ်အင်္ဂါရပ်များအတွက် နားလည်နိုင်ရန် အက်ပ်သည် အမည်မသိအသုံးပြုမှုဒေတာကို ပေးပို့ပါသည်။\nဒေတာကို ပြင်ပအဖွဲ့အစည်းများနှင့် မျှဝေမထားပါ။\nမူရင်း (နိုင်ငံနှင့်မြို့)၊ ဘာသာစကား၊ လည်ပတ်မှုစနစ်၊ စက်အမျိုးအစား၊ ကြည်လင်ပြတ်သားမှု၊ နှိပ်သည့်အပြုအမူနှင့် အသုံးပြုမှုကြာချိန်တို့အကြောင်း အချက်အလက်များကို စုဆောင်းနိုင်ပါသည်။\n\nစက်ပစ္စည်းဒေတာ။\nဝန်ဆောင်မှုသို့ ချိတ်ဆက်ရန် သင်အသုံးပြုသည့် စက်အရေအတွက်နှင့် အမျိုးအစားနှင့် ပတ်သက်သည့် ဒေတာအပြင် အဆိုပါ စက်များတွင် လည်ပတ်မှုစနစ်အကြောင်း အချက်အလက် (ဥပမာ Android၊ iOS၊ Windows သို့မဟုတ် macOS) တို့ကို စုဆောင်းပါသည်။\n\nအက်ပ်ကိုအသုံးပြုခြင်းဖြင့်၊ သင်သည် အထက်တွင်ဖော်ပြထားသည့်အတိုင်း အမည်မဖော်လိုသည့် ဒေတာစုဆောင်းခြင်းကို သင်သဘောတူပါသည်။';
  }

